import React from "react";
import Header from "../BooksSearchPage/Header.js";
import styles from "./Page.module.css";
function Page() {
  return (
    <React.Fragment>
      <Header
        url={JSON.parse(localStorage.getItem("cred")).user.photoURL}
      ></Header>
      <section className={styles.body}>
        <div className={styles.img}>
          <img src={JSON.parse(localStorage.getItem("cred")).user.photoURL} />
        </div>
        <div className={styles.content}>
          <h1>Mahakali</h1>
          <p className={styles.authors}>By Bijoy</p>
          <p className={styles.publishers}>Oreily</p>
          <p className={styles.description}>
            Introduces Java Data Objects and its capabilities, explains how to
            make classes persistent, how to configure JDO, how to make queries,
            how to perform transactions, and its use in Web applications and
            J2EE environments..
          </p>
          <p className={styles.pubdate}></p>
          <p className={styles.page}>2389 pages</p>
          <p className={styles.lang}>English</p>
        </div>
      </section>
    </React.Fragment>
  );
}
export default Page;
